        "title": "4000° PLASMA PROTO-LIGHTSABER BUILD (RETRACTABLE BLADE!)",
        "description": "Download and play AFK Arena for free ► https://bit.ly/3cvZ7dB \nUse these bonus codes: BestRPG4BusyU and uf4shqjngq to get awesome rewards.\n\nBecome a Hacksmith member get exclusive perks, like watching our Lightsaber Test video right now! ►►► https://youtu.be/ey_EjSzKFWQ\nYou'll also get...\n►Project design files (CAD)!\n►Merch Discounts!\n►Collaborate with us on our videos!\n\nTry Altium Designer for Free and start designing your own PCBs ► https://www.altium.com/asp/hacksmith\nView & share electronic designs online ►https://www.altium.com/viewer/\n\nCheck out the circuit diagram at Maker.IO ► https://www.digikey.com/en/maker/projects/the-hacksmith-retractable-plasma-lightsaber/d14232ad19c4454ebdc1dd6bbaef5f78\n\nMake your own PCBs ► https://jlcpcb.com/  \n$2  2Layer 5PCBs!\n$5  4 Layer 5PCBs!\n\nEpic Starwars Music and more by Samuel Kim ► https://www.youtube.com/user/samuelkimmusic\n\nThe hilt design was inspired by multiple different renderings we found online, with some of the main inspiration from Adam Rzatkowski ► www.artstation.com/aionard\n\nSOCIAL\nWebsite ► http://www.hacksmith.tech\nFacebook ► http://www.facebook.com/thehacksmith\nInstagram ► http://www.instagram.com/thehacksmith\nTwitter ► http://twitter.com/thehacksmith\nPatreon ► http://www.patreon.com/thehacksmith\nDiscord ► https://discordapp.com/invite/thehacksmith \nMerch ► https://www.hacksmith.store\n\nCHAPTERS:\n0:00 Teaser\n0:33 A real retractable lightsaber\n3:28 New hilt design\n4:17 Support our channel!\n5:22 Building new hilt\n9:07 How does it work?\n12:00 Different blade colors?\n13:22 Electronics\n15:00 Powerpack\n16:27 World's First Retractable Lightsaber\n17:05 TEST!\n\nSOFTWARE:\nVideo Review / Collaboration ► http://r.frame.io/pZq3N\nVideo Editing ► Adobe Premiere \nVFX ► https://productioncrate.grsm.io/Hacksmith\nCAD ► Solidworks \nCAM ► Autodesk HSM http://bit.ly/HSMworks\n\nCAMERA GEAR:\nHighspeed Cam - Chronos 1.4 ► http://bit.ly/chronosCam\nMain shooter