      "snippet": {
        "publishedAt": "2022-05-22T23:18:57Z",
        "channelId": "UCf3YCcUSYl41izTw6QOIbmg",
        "title": "Hayden Christensen And Ewan McGregor FIGHT Footage! (Star Wars Behind The Scenes)",
        "description": "Some great behind the scenes footage of Ewan McGregor and Hayden Christensen working together on Revenge Of The Sith. You can really see the synergy between them as artists. Hayden and Ewan really threw themselves into the roles. Their passion for the charcaters really shows. Great to see George doing his thing and being the true father of Star Wars!\n\nEnjoy: https://youtu.be/s5n1H_VTas8\n\nThis footage is Inspiration for the upcoming new Disney Series. The story begins 10 years after the dramatic events of “Star Wars: Revenge of the Sith” where Obi-Wan Kenobi faced his greatest defeat—the downfall and corruption of his best friend and Jedi apprentice, Anakin Skywalker, who turned to the dark side as evil Sith Lord Darth Vader. The series stars Ewan McGregor, reprising his role as the iconic Jedi Master, and also marks the return of Hayden Christensen in the role of Darth Vader. Joining the cast are Moses Ingram, Joel Edgerton, Bonnie Piesse, Kumail Nanjiani, Indira Varma, Rupert Friend, O’Shea Jackson Jr., Sung Kang, Simone Kessell and Benny Safdie.\n\n#starwarsfan #darthvader #obiwankenobi",
